import React from 'react'
import Logo from "../Assets/logo2.png"
const Footer = () => {
  return (
    <div className="flex flex-row p-4 w-screen  flex justify-center xs:text-xs sm:text-sm md:text-md lg:text-lg lg:h-[110px] md:h-[5rem] sm:h-[4rem] xs:h-[3rem] bg-white rounded-sm shadow-xl shadow-gray-500">
        <img src={Logo} alt="" className='w-[300px] h-[54px]'/>

    </div>
  )
}

export default Footer
